import { useSelector } from "react-redux"

const selectDays = state => state.categories.days

function ChartAll(props) {

    const days = useSelector(selectDays)

    // Array of all days [{},{},{}]
    const daysValues = Object.values(days)

    // Array of all ids ["", "", ""]
    const daysIds = daysValues.map((day) => day.id)
    console.log(daysIds)

    const categoriesValues = daysValues.map((day) => Object.values(day.categories))
    console.log(categoriesValues)
    const categories = Object.values(categoriesValues)
    console.log(categories)

    return (
        <div>
            Chart
        </div>
    )

}

export default ChartAll
